import React from 'react';
import { DatePicker, Card } from 'antd';

import './App.scss';

function App() {

  const test = (date, dateStrings) => {
    console.log(date, dateStrings);
  }
  return (
    <div className="App">
      <h1>Web Personal - Cliente <span>- Jorge</span></h1>
      <h2>Proyecto</h2>
      <DatePicker onChange={test} />

      <Card title="Test...."
        style={{ width: 300 }}>
        <p>Hola Mundo!</p>
      </Card>
    </div>
  );
}

export default App;
